import React, { useState, useEffect } from 'react';
import "./styles/Timer.css";

export default function Timer({ isOpen }) {
    const [time, setTime] = useState(0);

    useEffect(() => {
        const intervalId = setInterval(() => {
            setTime(prevTime => prevTime + 10); // Öka tiden med 10 millisekunder (0.01 sekunder)
        }, 10); // Uppdatera varje 10 millisekunder (0.01 sekund)

        return () => clearInterval(intervalId); // Städa upp intervallet när komponenten avmonteras
    }, []);

    // Beräkna minuter, sekunder, hundradelar och tusendelar av sekunder
    const minutes = Math.floor(time / (60 * 1000));
    const seconds = Math.floor((time % (60 * 1000)) / 1000);
    const milliseconds = Math.floor((time % 1000) / 10); // Räkna hundradelar av sekunder
    const microseconds = time % 10; // Räkna tusendelar av sekunder

    // Formatera tiden med två siffror (t.ex. 09 istället för 9)
    const formattedTime = `${minutes.toString()}:${seconds.toString().padStart(2, '0')}:${milliseconds.toString().padStart(2, '0')}.${microseconds.toString().padStart(2, '0')}`;

    return (
        <div className="home-wrapper" style={{ filter: isOpen ? "blur(4px) brightness(40%)" : "blur(0) brightness(100%)" }}>
            <h2>Timer</h2>

            <div className="timer">
                <h1>{formattedTime}</h1>
            </div>

            <div className="save-button-wrapper">
                <button className="save-button"></button>
            </div>
        </div>
    );
}
